import { GridColumn, GridRow } from "emotion-flex-grid";
import React from "react";

export default function Menu() {
  return (
    <div>
      <GridRow>
        <GridColumn>Deposit</GridColumn>
        <GridColumn>Dashboard</GridColumn>
        <GridColumn>Company</GridColumn>
        <GridColumn>Pricing</GridColumn>
      </GridRow>
    </div>
  );
}
